// src/components/Sidebar.js
import React from 'react';
import { NavLink } from 'react-router-dom';
import './Sidebar.css';
import profileImage from '../assets/profile.jpg';

function Sidebar() {
    return (
        <div className="sidebar">
            <div className="profile-container">
                <img src={profileImage} alt="Kaushik Das" className="profile-image" />
            </div>
            <h2>Kaushik Das</h2>
            <p>AI Developer | Machine Learning Engineer</p>
            <div className="contact-info">
                <p>Email: Kaushikdas.career@gmail.com</p>
                <p>Phone: +44 07388449042</p>
                <a href="https://www.linkedin.com/in/kaushikdas-connections" target="_blank" rel="noopener noreferrer">LinkedIn</a>
                <a href="https://github.com/Kaushik0621" target="_blank" rel="noopener noreferrer">GitHub</a>
                <a href="https://devpost.com/kaushik0621" target="_blank" rel="noopener noreferrer">Devpost</a>
                <a href="https://twitter.com/kaushik0621" target="_blank" rel="noopener noreferrer">Twitter</a>
            </div>
            <nav>
                <NavLink exact to="/" activeClassName="active-link">Home</NavLink>
                <NavLink to="/projects" activeClassName="active-link">Projects</NavLink>
                <NavLink to="/experience" activeClassName="active-link">Experience</NavLink>
                <NavLink to="/education" activeClassName="active-link">Education</NavLink>
                <NavLink to="/certifications" activeClassName="active-link">Certifications</NavLink>
                <NavLink to="/skills" activeClassName="active-link">Skills</NavLink>
                <NavLink to="/contact" activeClassName="active-link">Contact</NavLink>
            </nav>
        </div>
    );
}

export default Sidebar;
